State moves to delete the penalty enhancer on count 1.   Motion granted.   
Count 1 - Deliver fentanyl - No contest plea.   Convicted.   State moves to dismiss and read in count 2.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for four (4) years.   Conditions of probation are: 
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) Comply and complete Manitowoc County Drug Court; 
3) Maintain absolute sobriety except for prescriptions taken in prescribed doses; 
4) Submit to random urine screens and pay for same; 
5) Maintain full-time employment/schooling combination; 
6) Twelve (12) months jail imposed and stayed, to be imposed upon the discretion of the agent and upon order of the court; 
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC;
9) Submit DNA sample.  
Minutes.
